pragma solidity 0.4.25;

// import "./Team.sol";

contract Projects {

    struct Project {

        string title;
        string idea;
        uint fund;

    }

    mapping(address => uint) public Ati;
    mapping(uint => address)public Ita;
    mapping(uint => Project) public Projectmap;
    uint public projectCount;

    function setProject(string t,string i,uint f) public {
        projectCount++;
        Ati[msg.sender]=projectCount;
        Ita[projectCount]=msg.sender;
        Projectmap[projectCount] = Project(t,i,f);
    }

    function getProjectbyaddress(address a) public view returns(string,string,uint){
        return (Projectmap[Ati[a]].title,Projectmap[Ati[a]].idea,Projectmap[Ati[a]].fund);
    }

}
